import './proctree.lib';
import {updateHotComponent} from '../../utils/aframe-utils';

var defaultTrunkData = 'data:image/jpeg;base64,';
var defaultBranchData = 'data:image/png;base64,';

function getTextureFromString (str, cb) {
  if (typeof cb != 'function') throw new Error('param 2 must be a callback function');

  var canvas = document.createElement('canvas');
  var ctx = canvas.getContext('2d');

  var image = new Image();
  image.onload = function () {
    canvas.width = canvas.height = 256;
    try {
      ctx.drawImage(image, 0, 0);
    } catch (e) {
      console.warn('texture failed', e);
    }

    var texture = new THREE.Texture(canvas);
    texture.needsUpdate = true;
    cb(texture);
  };
  image.src = str;
}

function getTexture (elId, cb) {
  if (typeof cb != 'function') throw new Error('param 2 must be a callback function');
  var canvas = document.createElement('canvas');
  canvas.width = canvas.height = 256;
  var ctx = canvas.getContext('2d');

  try {
    ctx.drawImage(document.getElementById(elId), 0, 0);
  } catch (e) {
    console.warn('texture failed', e);
  }

  var texture = new THREE.Texture(canvas);
  texture.needsUpdate = true;
  cb(texture);
}

/**
 * A tree generator
 * Note use {@link http://www.snappytree.com/} to test configuration parameters
 * obj//configuration stuff
 * res ={};a=Reflect.ownKeys(obj).forEach(function(k){res[k]= {type:"number",default:obj[k]}});JSON.stringify(res)
 *
 * TODO for material see  http://jsfiddle.net/nhspjkb4/6/
 * TODO have a cache for trees where params/schema are equal
 *
 *
 */
updateHotComponent('proctree');
AFRAME.registerComponent('proctree', {
  schema: {
    'seed': {'type': 'number', 'default': 262},
    'segments': {'type': 'number', 'default': 6},
    'levels': {'type': 'number', 'default': 5},
    'vMultiplier': {'type': 'number', 'default': 2.36},
    'twigScale': {'type': 'number', 'default': 0.39},
    'initalBranchLength': {'type': 'number', 'default': 0.49},
    'lengthFalloffFactor': {'type': 'number', 'default': 0.85},
    'lengthFalloffPower': {'type': 'number', 'default': 0.99},
    'clumpMax': {'type': 'number', 'default': 0.454},
    'clumpMin': {'type': 'number', 'default': 0.404},
    'branchFactor': {'type': 'number', 'default': 2.45},
    'dropAmount': {'type': 'number', 'default': -0.1},
    'growAmount': {'type': 'number', 'default': 0.235},
    'sweepAmount': {'type': 'number', 'default': 0.01},
    'maxRadius': {'type': 'number', 'default': 0.139},
    'climbRate': {'type': 'number', 'default': 0.371},
    'trunkKink': {'type': 'number', 'default': 0.093},
    'treeSteps': {'type': 'number', 'default': 5},
    'taperRate': {'type': 'number', 'default': 0.947},
    'radiusFalloffRate': {'type': 'number', 'default': 0.73},
    'twistRate': {'type': 'number', 'default': 3.02},
    'trunkLength': {'type': 'number', 'default': 2.4}
  },
  init: function () {
    console.log('TREETREETREETREETREETREETREETREE', this.data);
    // Helper function to transform the vertices and faces
    function newTreeGeometry (tree, isTwigs) {
      var output = new THREE.Geometry();

      tree[isTwigs ? 'vertsTwig' : 'verts'].forEach(function (v) {
        output.vertices.push(new THREE.Vector3(v[0], v[1], v[2]));
      });

      var uv = isTwigs ? tree.uvsTwig : tree.UV;
      tree[isTwigs ? 'facesTwig' : 'faces'].forEach(function (f) {
        output.faces.push(new THREE.Face3(f[0], f[1], f[2]));
        output.faceVertexUvs[0].push(f.map(function (v) {
          return new THREE.Vector2(uv[v][0], uv[v][1]);
        }));
      });

      output.computeFaceNormals();
      output.computeVertexNormals(true);

      return output;
    }

    // --------------------------------------------------------
    var tree = new window.Tree(this.data);
    // --------------------------------------------------------

    var trunkGeo = newTreeGeometry(tree);

    // getTexture('trunk',
    getTextureFromString(defaultTrunkData,
      function (trunkTexture) {
        trunkTexture.wrapS = THREE.RepeatWrapping;
        trunkTexture.wrapT = THREE.RepeatWrapping;
        trunkTexture.repeat.set(1 / 2.5, 1 / 2.5);

        var trunkMaterial = new THREE.MeshLambertMaterial({ map: trunkTexture, wireframe: false });
        // var trunkMaterial = new THREE.MeshLambertMaterial({color: 0xdddddd, wireframe: false});
        var trunkMesh = new THREE.Mesh(trunkGeo, trunkMaterial);
        this.el.setObject3D('trunkMesh', trunkMesh);
      }.bind(this));

    var twigsGeo = newTreeGeometry(tree, true);

    // getTexture('branch',
    getTextureFromString(defaultBranchData,

      function (twigTexture) {
      // Scaling the texture seems to help
        twigTexture.wrapS = THREE.RepeatWrapping;
        twigTexture.wrapT = THREE.RepeatWrapping;
        // twigTexture.repeat.set( 1/2.5, 1/2.5 );

        // immediately use the texture for material creation
        var twigsMaterial = new THREE.MeshLambertMaterial({
          map: twigTexture,
          side: THREE.DoubleSide,
          alphaTest: 0.5
        });

        // var twigsMaterial = new THREE.MeshLambertMaterial({color: 0x999999, wireframe: false});
        var twigsMesh = new THREE.Mesh(twigsGeo, twigsMaterial);

        this.el.setObject3D('twigsMesh', twigsMesh);
      }.bind(this));
  },
  tick: function (time, timeDelta) {

  },

  remove: function () {
    this.el.removeObject3D('trunkMesh');
    this.el.removeObject3D('twigsMesh');
  }

});
